import Container from './components/Container';
import Bubbles from './components/Bubbles';
import { Switch, Route, Redirect } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      < NavigationBar />
      <Container>
        <Bubbles />
      </Container>
    </div>

  );
}

export default App;
